import React from 'react';
import Frame70 from './Frame70';

const Banner = () => {
  return (
    <div
      style={{
        width: '1440px',
        height: '500px',
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center',
        overflow: 'hidden',
        margin: '0 auto',
        background: 'linear-gradient(90deg, #F23D31 0%, #D23429 100%)',
        position: 'relative',
      }}
    >
      <Frame70 />
      <img
        src="/group39.png"
        alt="Logo 39"
        style={{
          position: 'absolute',
          left: 0,
          bottom: 0,
          height: '62.89px',
          zIndex: 2,
        }}
      />
    </div>
  );
};

export default Banner;
